import React from 'react'
import { Card, CardImg, CardImgOverlay, CardTitle, Breadcrumb, BreadcrumbItem } from 'reactstrap';

function ListOrder({ example }) {
    return (

        <Card>
            <CardImg src={example.image} alt={example.name}></CardImg>
            <CardImgOverlay>
                <CardTitle>{example.name}</CardTitle>

            </CardImgOverlay>
        </Card>

    );

}

function Order(props) {
    const item = props.examples.map(example => {
        return (

            < div key={example.id} className="col-md-5 m-1" >
                <ListOrder example={example} />
            </div >

        );

    });
    return (
        <div className="container">
            <div className="row">
                {item}
            </div>
        </div>
    )
}

export default Order;
